import test from "ava";
import { IdeaEncryptTransform, IdeaDecryptTransform } from "transforms/modern/idea";
import { testBytesToBytes } from "../_testutils";
import { hexToBytes, bytesToHex } from "cryptopunk.utils";

function doTestEncrypt(title, expectedHex, messageHex, keyHex)
{
	const key = hexToBytes(keyHex);
	test("IDEA encrypts " + title, testBytesToBytes, IdeaEncryptTransform, expectedHex, messageHex, key);
	test("IDEA decrypts " + title, testBytesToBytes, IdeaDecryptTransform, messageHex, expectedHex, key);
}

function doTestDecrypt(title, expectedHex, messageHex, keyHex)
{
	const key = hexToBytes(keyHex);
	test("IDEA decrypts " + title, testBytesToBytes, IdeaDecryptTransform, expectedHex, messageHex, key);
	test("IDEA encrypts " + title, testBytesToBytes, IdeaEncryptTransform, messageHex, expectedHex, key);
}

